INSERT INTO `v1_c2eec0e6dec3433f29edd568facb1dc5af237bd82719db1e8dfe87e267b3168b` VALUES (0.0, 0.0, 24, 4, 1, "2019/07/31 12:00:00", "2030/12/17 14:59:59", 0.0, 24015, 4, 10021, "カオリ（サマー）", 110501, "あうぅ～残念さ～\nマジムンに魂を\n奪われちゃったかな～？");
INSERT INTO `v1_c2eec0e6dec3433f29edd568facb1dc5af237bd82719db1e8dfe87e267b3168b` VALUES (0.0, 0.0, 24, 1, 2, "2019/07/31 12:00:00", "2030/12/17 14:59:59", 4.0, 24016, 4, 10021, "カオリ（サマー）", 110501, "今日は踊りのキレも悪いよ～\nゴーヤーっぽいもの食べて、元気回復さ～！");
INSERT INTO `v1_c2eec0e6dec3433f29edd568facb1dc5af237bd82719db1e8dfe87e267b3168b` VALUES (0.0, 0.0, 24, 4, 3, "2019/07/31 12:00:00", "2030/12/17 14:59:59", 0.0, 24017, 4, 10021, "カオリ（サマー）", 110501, "マジムンだらけで目が回るさ～！\nふらふらさ～！");
INSERT INTO `v1_c2eec0e6dec3433f29edd568facb1dc5af237bd82719db1e8dfe87e267b3168b` VALUES (0.0, 0.0, 24, 2, 4, "2019/07/31 12:00:00", "2030/12/17 14:59:59", 5.2, 24018, 1, 10021, "カオリ（サマー）", 110501, "なんくるない、なんくるない\n次、頑張ればいいんだよ～！\n海で泳いで\nリフレッシュするさー！");
INSERT INTO `v1_c2eec0e6dec3433f29edd568facb1dc5af237bd82719db1e8dfe87e267b3168b` VALUES (0.0, 0.0, 24, 6, 5, "2019/07/31 12:00:00", "2030/12/17 14:59:59", 4.2, 24019, 5, 10021, "カオリ（サマー）", 110501, "恥ずかしいところ\n見られちゃったね～\n水着？　水着のことじゃないよー？");
INSERT INTO `v1_c2eec0e6dec3433f29edd568facb1dc5af237bd82719db1e8dfe87e267b3168b` VALUES (0.0, 0.0, 24, 2, 6, "2019/07/31 12:00:00", "2030/12/17 14:59:59", 0.0, 24020, 2, 10021, "カオリ（サマー）", 110501, "絶好調さ～！　この調子で\n海の平和を取り戻すよ～！\n楽しい夏が待ってるさ～！");
INSERT INTO `v1_c2eec0e6dec3433f29edd568facb1dc5af237bd82719db1e8dfe87e267b3168b` VALUES (0.0, 0.0, 24, 6, 7, "2019/07/31 12:00:00", "2030/12/17 14:59:59", 6.4, 24021, 1, 10021, "カオリ（サマー）", 110501, "何匹で襲ってきたって\n私はマブイを落っことさないよ～！\nくしゅん！　あ……\n今のくしゃみで落っこちたかも～？");
INSERT INTO `v1_c2eec0e6dec3433f29edd568facb1dc5af237bd82719db1e8dfe87e267b3168b` VALUES (0.0, 0.0, 24, 2, 8, "2019/07/31 12:00:00", "2030/12/17 14:59:59", 0.0, 24022, 2, 10021, "カオリ（サマー）", 110501, "ひーやーさーさー♪\n戦いの後は、踊りを踊って\n気分スッキリさ～！");
INSERT INTO `v1_c2eec0e6dec3433f29edd568facb1dc5af237bd82719db1e8dfe87e267b3168b` VALUES (0.0, 0.0, 24, 3, 9, "2019/07/31 12:00:00", "2030/12/17 14:59:59", 10.08, 24023, 6, 10021, "カオリ（サマー）", 110501, "あれ～？　戦ってるうちに\n水着がどっか行っちゃった～？\nねぇキミ、どっかで見なかった～？\nなんで離れるさ～？");
INSERT INTO `v1_c2eec0e6dec3433f29edd568facb1dc5af237bd82719db1e8dfe87e267b3168b` VALUES (0.0, 0.0, 24, 2, 10, "2019/07/31 12:00:00", "2030/12/17 14:59:59", 5.0, 24024, 1, 10021, "カオリ（サマー）", 110501, "まだまだ私は元気だよ～！\nマジムンでもなんでも、\nどんとこーいさー♪");
INSERT INTO `v1_c2eec0e6dec3433f29edd568facb1dc5af237bd82719db1e8dfe87e267b3168b` VALUES (0.0, 0.0, 24, 2, 11, "2019/07/31 12:00:00", "2030/12/17 14:59:59", 0.0, 24025, 2, 10021, "カオリ（サマー）", 110501, "私の空手は世界最強さ～！\n夏の陽射しと青い海も合わされば、\n向かうところ敵なしだよー！");
